def mid_Procedure(tmp):
  '''
    返回测试样例三中的连乘，使用lambda表达式返回的值是错的（没有找到原因）
    因此选用显式的函数来定义
  '''
  all = 1.0
  for i in range(1,len(tmp)+1):
    all = all * np.cos(tmp[i-1]/np.sqrt(i))
  return all

